  false,\n\t\"url\": null,\n\t\"notes\": \"Bioenergy Knowledge Discovery Framework
  (BioKDF) supports the bioenergy infrastructure effort to move the nation towards
  sustainable, renewable energy solution. The BioKDF facilitates informed decision
  making by providing a means to synthesize, analyze, and visualize vast amounts of
  information in a relevant and succinct manner. It is designed to comprehensively
  analyze the economic and environmental impacts of various development options for
  biomass feedstocks, biorefineries, and related infrastructure.\",\n\t\"license_title\":
